import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import CovidSummary from './components/CovidSummary';
import CovidPie from './components/CovidPie';
import covid from './images/covid.png';


ReactDOM.render(
  <React.StrictMode>
    <img src={covid} style={{width: '50px', height: '50px'}}/>
    <CovidSummary />
    <CovidPie />
  </React.StrictMode>,
  document.getElementById('root')
);
